@KateEMcCann "Were you at the party in your own flat?"
"I can't say, wait for the conclusion of the inquiry, blah blah, waffle waffle"
(Repeat ad nauseum)

@susie_dent My nan: "'I see' said the blind man. Who couldn't see at all at all". 
And of course: "He has more jumpers/coats/shoes than Soft Mick".
"Well, I'll go to me tea."

